import React from "react";
import "./NewsletterEmailsStyle.css";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faTrash } from "@fortawesome/free-solid-svg-icons";

const NewsletterEmailsList = ({ emails, toggleDeleteModal }) => {
  return (
    <>
      <h2 className="emails_list_title">Абонаменти</h2>
      <table className="email">
        <thead>
          <tr>
            <th>#</th>
            <th>Имейл</th>
            <th>Опции</th>
          </tr>
        </thead>
        <tbody>
          {emails.map((email, index) => {
            return (
              <tr style={{ fontSize: 20, padding: 15 }} key={index}>
                <td> {index + 1}</td>
                <td>{email.email}</td>
                <td>
                  <FontAwesomeIcon
                    onClick={() => toggleDeleteModal(email.email)}
                    className="delete"
                    icon={faTrash}
                  />{" "}
                </td>
              </tr>
            );
          })}
        </tbody>
      </table>
    </>
  );
};

export default NewsletterEmailsList;
